import React from 'react';
import './App.css';
import {Button, Form} from 'react-bootstrap';
import { Route } from 'workbox-routing';
import SignIn from './pages/SignIn';



function App() {
  return (
    <div className="App">
      <Route path='/signin' element={<SignIn/>}/>
    </div>
  );
}

export default App;
